import '../styles/DisplayUserDevice.css';
function Device({ descriptionText, addressText, energyText }){
    return(
    <div className='container' onClick>
        <label>Description: {descriptionText}</label>
        <label>Address: {addressText}</label>
        <label>Maximum hourly energy consumption: {energyText}</label>
    </div>

    );
}

export default Device;
